import ReactDOM from 'react-dom/client';
import './index.css';
import 'normalize.css'
import App from './App';
import { AppProvider } from './Context/AppContext';

ReactDOM.render(
  <React.StrictMode>
    <AppProvider></AppProvider>
      <App />
  </React.StrictMode>,
  document.getElementById('root')
